			\n				<h2>\n			<a href="http://content.tesseracttheme.com/2015/create-a-wordpress-website-2015/">\n				Create a WordPress Website 2015			</a>\n		</h2>\n						<p>Create a WordPress Website 2015 In this lesson I show you how to create a website step by step with no step skipped.  You will be learning how to do everything in 2 hours.  How to setup hosting, create a WordPress website, install a theme, get free images.</p>\n						Posted by Tyler														on							September 16, 2014					\n				<h2>\n			<a href="http://content.tesseracttheme.com/2014/hello-world/">\n				Hello world!			</a>\n		</h2>\n						<p>Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!</p>\n', 'Blog Layout', '', 'publish', 'closed', 'closed', '', 'blog-layout', '', '', '2016-04-30 04:07:50', '2016-04-30 04:07:50', '', 0, 'http://localhost:8888/2016/04/30/blog-layout/', 0, 'fl-builder-template', '', 0),
(23, 1, '2016-04-30 04:07:50', '2016-04-30 04:07:50', '\n	<p><strong>About Us</strong></p><p><a href="http://www.tyler.com">Founders</a></p>\n	<h1>About Us</h1><p>Founded in August of 2008 and based in San Francisco, California, Airbnb is a trusted community marketplace for people to list, discover, and book unique accommodations around the world — online or from a mobile phone or tablet.</p><p>Whether an apartment for a night, a castle for a week, or a villa for a month, Airbnb connects people to unique travel experiences, at any price point, in more than 34,000 cities and 190 countries. And with world-class customer service and a growing community of users, Airbnb is the easiest way for people to monetize their extra space and showcase it to an audience of millions.</p>\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185033/morocco-123961_1280.jpg" alt="morocco-123961_1280" itemprop="image" />\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185009/mountains-863474_1280.jpg" alt="mountains-863474_1280" itemprop="image" />\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185701/mt-fuji-477832_1920.jpg" alt="mt-fuji-477832_1920" itemprop="image" />\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185139/iceberg-404966_1920.jpg" alt="iceberg-404966_1920" itemprop="image" />\n	<p>Whether an apartment for a night, a castle for a week, or a villa for a month, Airbnb connects people to unique travel experiences, at any price point, in more than 34,000 cities and 190 countries. And with world-class customer service and a growing community of users, Airbnb is the easiest way for people to monetize their extra space and showcase it to an audience of millions.</p>', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2016-04-30 04:07:50', '2016-04-30 04:07:50', '', 0, 'http://localhost:8888/2016/04/30/about-us/', 0, 'fl-builder-template', '', 0),
(24, 1, '2016-04-30 04:07:50', '2016-04-30 04:07:50', '				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07185053/moon1.png" alt="moon1" itemprop="image" />\r\n	<h1><strong>Our Pricing Perspective</strong></h1>\r\n<p>Team communication is at the heart of every business. It''s the thing that connects your entire organization and has the biggest impact on your culture and productivity.</p>\r\n<p>For decades, team communication software has been a race to the bottom with clunky and cheap solutions that offer far more frustration than value. We want to change that by offering you a product that just works. And we want it to be a great value for your entire organization - with a growing lineup of new features, helpful on-boarding, and responsive support.</p>\r\n<p>We believe Slack is an investment in your team and culture. So we set our pricing at a level that allows us to invest in building a solid product, and more importantly, a great experience for you as our customers.</p>\r\n', 'Color Image Text Box', '', 'publish', 'closed', 'closed', '', 'color-image-text-box', '', '', '2016-04-30 04:07:50', '2016-04-30 04:07:50', '', 0, 'http://localhost:8888/2016/04/30/color-image-text-box/', 0, 'fl-builder-template', '', 0),
