(47, 1, '2016-04-30 04:07:50', '2016-04-30 04:07:50', '\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07190024/float11.png" alt="float1" itemprop="image" />\n	<h2 style="text-align: center;">services</h2><p style="text-align: center;">We help you relax so you can go within and begin your work. This helps you reflect so you can enjoy your life.</p><p style="text-align: center;"><a href="/services">View Services</a></p>\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07190032/Gallery1.png" alt="Gallery" itemprop="image" />\n	<h2 style="text-align: center;">our work</h2><p style="text-align: center;">See the work we do around the world. Be inspired to join us on our mission to make the world a better place.</p><p style="text-align: center;"><a href="/our-work">Our Work</a></p>\n				<img src="http://tylers-storage.s3-us-west-1.amazonaws.com/wp-content/uploads/2015/09/07190040/Ocean-Squid1.png" alt="Ocean-Squid" itemprop="image" />\n	<h2 style="text-align: center;">contact us</h2><p style="text-align: center;">Contact us to see what we can do for you. We can help you by giving you free advice or you can join us on a retreat.</p><p style="text-align: center;"><a href="/contact">Contact Us</a></p>', '3 Featured Boxes', '', 'publish', 'closed', 'closed', '', '3-featured-boxes', '', '', '2016-04-30 04:07:50', '2016-04-30 04:07:50', '', 0, 'http://localhost:8888/2016/04/30/3-featured-boxes/', 0, 'fl-builder-template', '', 0),
